                        phi( currentFuncPos , 1 ) = orient * 2*qsi[0]*(225*pow(qsi[0],14) + pow(qsi[1],13)*(203 + 15*qsi[1]) - 3006003*pow(qsi[0],5)*pow(qsi[1],8)*(29 + 30*qsi[1]) - 1002001*pow(qsi[0],9)*pow(qsi[1],4)*(29 + 150*qsi[1]) - 16562*pow(qsi[0],3)*pow(qsi[1],10)*(319 + 150*qsi[1]) + 1288287*pow(qsi[0],6)*pow(qsi[1],7)*(116 + 175*qsi[1]) + 91091*pow(qsi[0],4)*pow(qsi[1],9)*(319 + 225*qsi[1]) + 637*pow(qsi[0],2)*pow(qsi[1],11)*(754 + 225*qsi[1]) - 16562*pow(qsi[0],11)*pow(qsi[1],2)*(29 + 450*qsi[1]) - 736164*pow(qsi[0],7)*pow(qsi[1],6)*(203 + 450*qsi[1]) - 7*qsi[0]*pow(qsi[1],12)*(2639 + 450*qsi[1]) + 91091*pow(qsi[0],10)*pow(qsi[1],3)*(58 + 495*qsi[1]) + 429429*pow(qsi[0],8)*pow(qsi[1],5)*(203 + 675*qsi[1]) + 637*pow(qsi[0],12)*qsi[1]*(29 + 975*qsi[1]) - 7*pow(qsi[0],13)*(29 + 3150*qsi[1]));
